import ExpenseItem from "./components/ExpenseItem";

function App() {

  const expenses = [
    { id: 'i1', title: 'Item 1', date: new Date(2022, 4, 15), amount: 230 },
    { id: 'i2', title: 'Item 2', date: new Date(2022, 7, 2), amount: 130 },
    { id: 'i3', title: 'Item 3', date: new Date(2022, 9, 16), amount: 410 }
  ];

  return (
    <div>
      <h2>Daniel's List</h2>
      <ExpenseItem title={expenses[0].title} date={expenses[0].date} amount={expenses[0].amount}></ExpenseItem>
      <ExpenseItem title={expenses[1].title} date={expenses[1].date} amount={expenses[1].amount}></ExpenseItem>
      <ExpenseItem title={expenses[2].title} date={expenses[2].date} amount={expenses[3].amount}></ExpenseItem>

    </div>
  );
}

export default App;
